INSERT INTO `projects` (`id`, `owner_user_id`, `status_id`, `likelihood_id`, `programme_id`, `title`, `summary`, `start_date`, `finish_date`, `value_required`, `value_sourced`, `created`, `modified`, `deleted`)
VALUES
	(20,3,5,2,7,'Connecting the Causal Dots','Goal: To enhance Alert?s ability to assess and learn from the impact of its advocacy and dialogue work, communicate this impact and share its learning more effectively internally and with the wider peacebuilding sector. \r\n\r\nThe project aims to achieve this goal through two specific objectives:\r\n\r\n1.	To identify and communicate the impact of our advocacy and dialogue work, at different levels, to enable more effective, impactful and sustainable outcomes. \r\n2.	To contribute to the peacebuilding sector through sharing with partners and peers, the useful peacebuilding M&E methods that are generated by the project. \r\n','2014-11-27','2016-03-17',28476,28424,'2015-05-11 11:51:44','2015-05-11 12:01:46',0),
	(21,2,3,2,7,'PPA ','The UK, through the Department for International Development (DFID), will invest in a 3 year Programme Partnership Arrangement with International Alert between 2011 and 2014. An initial investment of £1,739,160 for 2011-12 has been agreed. Subsequent disbursements will be performance-based; as assessed through robust monitoring and evaluation mechanisms. \r\n\r\nThe results that this investment are expected to deliver are that:\r\n\r\n?	Global standards of international institutions? and actors? policy and programme engagement in fragile and conflict affected countries, which contribute to lasting conditions for peace, improve.\r\n\r\n?	Target international institutions, governments, private sector actors and civil society agencies apply concepts and methodologies, which reduce conflict and promote peacebuilding, in at least 10 fragile and conflict affected states. Specifically:\r\no	six international organisations will produce key planning and operational documents reflecting peacebuilding principles introduced by International Alert through dialogue, training and studies;\r\no	three private sector actors? operations will reflect conflict sensitivity and peacebuilding principles;\r\no	the number of international institutions, governments, private sector actors and civil society agencies taking up the key findings and recommendations emerging from International Alert?s climate change and conflict research will increase from zero to four;\r\no	the number of international institutions and civil society agencies which produce key planning or programme documents reflecting gender and peacebuilding analysis and guidelines developed by International Alert will increase from zero to three;\r\no	strengthened mechanisms for state-citizen engagement will be achieved in at least four countries through training and dialogue;\r\n\r\n?	Policy and programme recommendations, developed through participatory country level analysis, will be provided to at least four key international institutions and to civil society groups to support practical reforms in institutional peacebuilding practice. Specifically:\r\no	the number of planning and consultation processes with stakeholders will increase from three to 12;\r\no	the number of reports disseminated to target institutions will increase from zero to four; and\r\no	the number of dialogue processes with institutional representatives and stakeholders facilitated by International Alert to promote take-up of recommendations will increase from zero to four.\r\n\r\n?	Reports, training and guidelines that will help economic actors in at least three fragile and conflict affected countries strengthen their peacebuilding contribution, will be developed and disseminated. Specifically:\r\no	the number of companies / industry bodies provided with capacity building support in conflict sensitivity will increase from zero to eight;\r\no	the number of multinational companies in extractive industries accompanied by International Alert to incorporate conflict sensitivity into their business practice will increase from one to three; and\r\no	the number of published studies on strategies for local economic development which are responsive to the conflict context and peacebuilding objectives in conflict affected countries will increase from three to 12.\r\n\r\n?	In South Asia and at least one other region, there will be development and exchange of information on obstacles to climate change adaptation in fragile and conflict affected contexts through research, networking and consultations. Specifically:\r\no	local communities from six districts, across four countries, will be incorporated into the study;\r\no	twelve identifiable institutional interest groups will be consulted in research and engaged in dialogues; and\r\no	six description and dissemination forums with donor agencies and other relevant programme providers will be held to share findings and recommendations from the study.\r\n\r\n?	A major analytical report to establish an evidence base and provide practical guidelines on ways in which peacebuilding outcomes are strengthened by incorporation of gender analysis into peacebuilding programmes will be published. Within this:\r\no	detailed research and analysis will be undertaken for four country case studies;\r\no	four peacebuilding programmes will be included in the research and analysis; and\r\no	six consultation and dissemination processes with donors and other stakeholders to discuss research and findings and to share and test programming recommendations will be held.\r\n\r\n?	International Alert engage in inclusive dialogue processes that address how to build a peaceful state and incorporate lessons / experiences into advisory work with international agencies. This will support on-going strengthening of international peacebuilding in conflict affected countries. Specifically:\r\no	the number of countries in which International Alert engage in dialogue processes will increase from two to six;\r\no	the number of policy development processes involving international actors will increase from two to seven; and\r\no	the number of training and learning processes with foreign ministry staff and other key officials engaging in building bilateral relationships in conflict affected states will increase from three to twelve.\r\n\r\n\r\nImpact: Global standards of international institutions? and actors? policy and programme engagement in fragile and conflict affected countries, which contribute to lasting conditions for peace, improve.\r\n\r\nOutcome: Target international institutions, governments, private sector actors and civil society agencies apply concepts and methodologies, which reduce conflict and promote peacebuilding, in at least 10 fragile and conflict affected states.\r\n\r\nInternational Alert currently has active programmes in over 20 countries and territories in Africa, South-eastern Europe, the Middle East, Asia and Latin America. Where the context requires it, their country programmes are grouped and run with regional programmes, so as to be sure that the regional dimension of conflict drivers and peace factors is included in their programme planning and implementation. \r\n\r\nTheir evidence-based advocacy focuses on a number of key donor governments including the UK, as well as the EU institutions, the UN peacebuilding architecture, United Nations Development Programme (UNDP) and the World Bank. It is a keynote of their work that they feed their international policy work with their on-the-ground experience and by giving a voice to partner organisations ? facilitating Congolese women?s organisations to speak at the UN on rape and gender-based violence in eastern DRC, for example. They also bring policy information to the ground: for example, International Alert?s partners in Burundi recently monitored progress against gender-sensitive indicators for each of the UN Peacebuilding Fund?s activities.\r\n\r\nThroughout the PPA period and beyond, International Alert intend to maintain and extend its portfolio of activities. This will include consolidating current programmes and deepening their work, as well as initiating work in new programme countries and on new themes. Key new programme countries include Mali, Niger, Nigeria, Sudan, Bangladesh and Kyrgyzstan. Major themes in this new programming include the implications of climate change for conflict and peacebuilding, water security, political dialogue to build sustainable institutions, gender and the role of the private sector.\r\n\r\nThe intended high level outcomes, which they aim to achieve by a combination of work on the ground and in the sphere of international institutions, in the PPA period are:\r\n?	countries affected by violent conflict benefit from international policies and practice that increasingly align with in-country institutions in practical work to support peacebuilding and the peaceful management of conflict;\r\n?	in their programme countries, the private sector generates and engages in efforts that support peacebuilding and the peaceful management of conflict;\r\n?	international, regional and national policies on climate change adaptation and mitigation are designed so as to promote peaceful relations within and between countries;\r\n?	international peacebuilding policies incorporate strategies to contribute to non-violent and equitable gender relations in conflict-affected and fragile societies; and\r\n?	international policies and actions for state-building and to support good governance focus on improving states? responsiveness to their citizens? needs.\r\n\r\nMuch of International Alert?s work is an attempt to change the behaviour of key actors ? primarily institutions of various kinds, including informal as well as formal institutions, but also individuals who participate in and lead those institutions. This adds up to a diverse range of people, groups and organisations.\r\n\r\nPeacebuilding outcomes in these areas accord with DFID?s goals by strengthening the foundations for permanent poverty reduction and underpinning sustained progress towards achieving the Millennium Development Goals (MDGs). At the operational level, International Alert?s objectives are consistent with DFID?s Business Plan Priorities (May 2011)  with specific contributions across all six priority areas:\r\n1. International commitments ? they work with local change agents promoting participation in peacebuilding as part of inclusive social and economic development. \r\n2. Transparency in aid - their code of conduct establishes independence and accountability while their Programming Framework informs their programme delivery including design, monitoring and evaluation frameworks. \r\n3. Wealth creation - a core focus of their work is to engage with the private sector to enhance the role and conflict-sensitivity of economic development and recovery initiatives. \r\n4. Governance and security in fragile and conflict-affected countries - as a training provider to the UK Government (including the Stabilisation Unit), they have played a key role in generating professional integration in post-conflict reconstruction initiatives. As part of this they are starting work in the Horn of Africa.\r\n5. Improving the lives of girls and women - since their involvement in the 1999 global campaign for adoption of UNSCR 1325, they have been working consistently on initiatives to promote improved security and political empowerment of women and girls. \r\n6. Climate change - they aim to ensure adaptation incorporates governance reforms and builds resilience to social/political (including conflict) impacts of climate change.\r\n\r\nMore specifically, International Alert?s work also clearly contributes to the priorities of DFID?s Conflict, Humanitarian and Security department (CHASE) including: reducing violence against women; delivering a step change in impact, better results and value for money in countries affected by conflict, fragility and violence; and helping efforts to build stability overseas. Their work fits with CHASE?s drive to strengthen international institutions and multilateral effectiveness in preventing and responding to conflict and fragility as well as pursuing conflict sensitive programming that supports long term peacebuilding and state-building.\r\n\r\n','2011-05-19','2016-03-31',8695800,8,'2015-05-11 17:30:56','2015-05-12 12:50:52',0),
	(22,3,5,2,1,'Reconciliation and Socio-Economic Reintegration in Rwanda and Burundi','This project seeks to support reconciliation and socio-economic reintegration of those most affected by conflicts in Rwanda and Burundi.','2013-04-01','2016-03-31',275,NULL,'2015-05-14 16:10:20','2015-05-14 16:10:20',0),
	(23,2,5,2,2,'EPNK2','Goal: To increase the credibility and popular legitimacy of peacebuilding efforts around the Nagorno-Karabakh (NK) conflict. ','2012-03-01','2015-05-31',5600000,NULL,'2015-05-14 18:21:08','2015-05-14 18:23:25',0),
	(24,2,6,2,6,'Justice and Security Sector Reform 2','JSSR2, implemented in partnership with Saferworld, aims to harness the influence of the private sector to improve public security in 5 districts in Nepal.','2012-01-24','2014-02-24',450000,NULL,'2015-05-24 15:32:27','2015-05-24 15:32:27',0);
